import React from "react";
import styled from "styled-components";
import { gql } from "apollo-boost";

const GET_USER = gql`
  query seeUser($username: String!) {
    seeUser(username: $username) {
      id
      avatar
      username
      fullName
      isFollowing
      isSelf
      bio
      followingCount
      followersCount
      posts
    }
  }
`;

export default Profile;
